import react from 'react';


const CancelModal = ({setShowCancelModal}) => {

    const handleClose = () => {
        setShowCancelModal(false);
    }

    return(
        <div className='modal'>
                    <div className='modal-dialog'>
                    <div className='modal-content'>
                        <div className='modal-header'>
                        <h5 className='modal-title'>Atšaukti užsakymą</h5>
                        </div>
                        <div className='modal-body'>
                        <div class="form-group">
                            <label for="exampleFormControlTextarea1">Nurodyti priežastį:</label>
                            <textarea class="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                        </div>
                        </div>
                        <div className='modal-footer'>
                            <button type='button' class='btn btn-primary' onClick={handleClose}>Supratau</button>
                        </div>
                    </div>
                    </div>
                </div>
    )
}

export default CancelModal;
